package com.PrimeNumb.jnit;

public class PrimeNumb {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 1; i < 10; i++) {
			if (i % 2 == 1) {
				System.out.println("Prime Number" + "\t" + i);
			}else
			{
			System.out.println("Composite Number");	
			}

		}

	}

}
